// src/pages/Home.jsx
import React from 'react';
import '../styles/Home.css';

function Home() {
  return (
    <div className="home">
      <h2>Welcome to BukSU Lost and Found System</h2>
      <p>This is the Landing Page of our Lost and Found system.</p>
    </div>
  );
}

export default Home;
